const defaultState = {
    allBusinesses: []
  }


  export const reducer = (state = defaultState, action) => {

    console.log(action)

    switch(action.type){
      case "Load_Businesses": {
        return { ...state, allBusinesses: action.payload }
      }
      default:
        return state
    }
  }
